import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <div class="myheader" style={{ myheader }}>
                <center>Tasnim Ali</center>
            </div>
        );
    }
}



const myheader = {
    fontSize: 50
  };



export default Header;
